import React from 'react';
import { NavLink } from 'react-router-dom';



function Navbar() {


    return (
        <aside>
            <ul>
                <li>
                    <NavLink to='/addfood'>Add Food</NavLink>
                </li>
                <li>
                <NavLink to='/seefood'>See Food</NavLink>
                </li>
                <li>
                <NavLink to='/findfood'>Find Food</NavLink>
                </li>

            </ul>

        </aside>

    )

}

export default Navbar;
